// Gradients taken from: https://webgradients.com/
export default [
  {
    name: 'Je viens d\'arriver en France',
    description: '#f093fb → #f5576c',
    css: 'linear-gradient(135deg, #f093fb 0%, #f5576c 100%)',
    height: 400
  },
  {
    name: 'J\'ai fait ma demande de statut',
    description: '#5ee7df → #b490ca',
    css: 'linear-gradient(135deg, #5ee7df 0%, #b490ca 100%)',
    height: 400
  },
  {
    name: 'J\'ai obtenu le statut de réfugié',
    description: '#f6d365 → #fda085',
    css: 'linear-gradient(135deg, #f6d365 0%, #fda085 100%)',
    height: 200
  },
  {
    name: 'Je cherche à m\'intégrer',
    description: ' #ddd6f3 → #faaca8',
    css: 'linear-gradient(135deg, #ddd6f3 0%, #faaca8 100%, #faaca8 100%)',
    height: 200
  }
]
